import React from 'react'
import GoiCuon from '../assets/img/goi-cuon.png'
// import GoiBo from '../assets/img/goi-bo.'


const ProperImage = props => {
    const ItemImage = (props) =>{
        return(
            <image src={props.image} alt={props.imageTitle}/>
        )
    }

  switch(props.imageTitle){
    case 'goi-cuon':
        return <ItemImage image={GoiCuon} imageTitle={props.imageTitle} />
    default:
        console.error('not valid image string', `props.image: ${props.imageTitle}`)
  }
}

export default ProperImage
